export default class Test extends Component {
    constructor() {
        super();
        this.state = {pic: "<img 'src='./images/plus.png"};
      }
      changeBrand = () => {
        this.setState({brand: "BMW"});
      }
      changeBrand2 = () => {
          this.setState({brand: "Desire"})
      }
      render() {
        return (
          <div>
            <h1 onMouseOver={this.changeBrand} onMouseOut={this.changeBrand2}>My Car  {this.state.brand}</h1>
            <button >click me </button>
          </div>
        );}}
